is_package: true
container:
  type: HtmlTemplate
  properties: {html: '@theme:standard-page.html'}
components:
- type: ColumnPanel
  properties: {}
  name: content_panel
  layout_properties: {slot: default}
  components:
  - name: btnDashboard
    properties:
      text: |
        Dashboard
      role: outlined-button
      font_size: 11
    type: Button
    layout_properties: {grid_position: 'QPPZVN,NOOTGN'}
    event_bindings: {click: btnDashboard_click}
  - name: btnProfile
    properties: {text: Profile, role: outlined-button, font_size: 11}
    type: Button
    layout_properties: {grid_position: 'QPPZVN,PMKNNB'}
    event_bindings: {click: btnProfile_click}
  - name: spacer_1
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,QZGHWI'}
  - name: spacer_2
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,OEGQYL'}
  - name: spacer_3
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,OORCME'}
  - name: spacer_4
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,OAUICD'}
  - name: spacer_5
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,SUTUTC'}
  - name: spacer_6
    properties: {height: 32}
    type: Spacer
    layout_properties: {grid_position: 'QPPZVN,IDGQJJ'}
  - name: lblImportTitle
    properties: {align: center, text: Current Workouts, bold: true, font: '', font_size: 30}
    type: Label
    layout_properties: {grid_position: 'MVBWDX,IPZZFS'}
  - name: repeating_panel_1
    properties: {item_template: formImport.ItemTemplate2}
    type: RepeatingPanel
    layout_properties: {grid_position: 'ULBCIT,GFOFKU'}
  - name: lblImportWorkouts
    properties: {align: center, text: Import Workouts, font_size: 20}
    type: Label
    layout_properties: {grid_position: 'KHRODT,XBFRXS'}
  - name: selectedCSVFile
    properties: {text: Select CSV File}
    type: FileLoader
    layout_properties: {grid_position: 'IWROII,UPXRFR'}
    event_bindings: {change: selectedCSVFile_change}
  - name: process_button
    properties: {text: Import, role: outlined-button}
    type: Button
    layout_properties: {grid_position: 'MKWLNI,KAFGTR'}
    event_bindings: {click: process_button_click}
- type: FlowPanel
  properties: {}
  name: navbar_links
  layout_properties: {slot: nav-right}
